import styled from "styled-components"

const SignIn = styled.div`
    width:50vw;
    margin:0 auto;
    .buttons{
        display:flex;
        flex-direction:column;
    }
    p,span{
        margin:15px 0;
    }
    .sign-up{
        color:#b07b58;
        cursor:pointer;
    }
`

export default SignIn
